import React from 'react';

function PhytoplanktonExploration() {
  return (
    <div>
      <h2>Exploración del fitoplancton</h2>
      <h3>Fitopia</h3>
      <h3>Exploración del fitoplancton</h3>
      <h3>Tutoriales y recursos</h3>
      <h3>NASA's long-term chlorophyll record is unparalleled</h3>
    </div>
  );
}

export default PhytoplanktonExploration;
